window.bookSummaryJSON = "<p><b>Ashe is in trouble with a capital T.</b><br> <br> As merchandise heading to an intergalactic auction, Ashe’s future looks grim. So when a too-sexy-for-his-own-good alien outlaw solicits her help to break them out of lockup, she jumps on the chance. Ashe only needs to survive long enough with the known criminal to get her end of the bargain: freedom. She trusts the clawed and fanged Tallean warrior to keep her safe, but who will keep her safe from him?<br> <br> <b>A Tallean mercenary claims what he wants, and he wants her!</b><br> <br> As captain of an infamous mercenary vessel, Zeylum carefully crafts his dastardly reputation with crass words and a brutish exterior. But the little human triggers his need to own and protect, and Zey finds himself bonded to the one female he promised to let free.<br> <br> Will Ashe look past his rough facade and fall for the male beneath?<b> Because now that he’s had a taste of his mate, he will never let her go!</b><br> <br> <b>Feisty heroine, growly mercenary, and lots of action ahead. HEA guaranteed!</b></p>"; 
